import React from 'react';
import {Nav, 
  NavLink, 
  NavMenu,
} from './NavBarElements';

const Navbar = () => {
  return (
    <>
      <Nav>
        <NavMenu >
          <NavLink to="/home" activeStyle={{color:'black'}} style={{
          textDecoration:'none',
          color:'white'
          }}>
            Log In
          </NavLink>
          <NavLink to="/films" activeStyle={{color:'black'}} style={{
          textDecoration:'none',
          color:'white'
          }}>
            Films
          </NavLink>
          <div className="creds">
            <NavLink to="/about" activeStyle={{color:'black'}} style={{
            textDecoration:'none',
            color:'white'
            }}>
              Log In
            </NavLink>
            <NavLink to="/Form" activeStyle={{color:'black'}} style={{
            textDecoration:'none',
            color:'white'
            }}>
              Sign Up
            </NavLink>
          </div>
        </NavMenu>
      </Nav>
    </>
  );
};

export default Navbar;
